    /**
     * Creates a ConnectorModel object for the diagram.
     * @param id The unique identifier for the connector.
     * @param lineDashArray The dash array for the connector's stroke.
     * @param source The ID of the source node.
     * @param target The ID of the target node.
     * @param lineColor The color of the connector's stroke.
     * @param lineWidth The width of the connector's stroke.
     * @param sourcePortId The ID of the source port.
     * @param targetPortId The ID of the target port.
     * @returns A ConnectorModel object configured with the provided properties.
     */
    private createConnector(id: string, lineDashArray: string, source: string, target: string,
        lineColor: string, lineWidth: number, sourcePortId: string, targetPortId: string): ConnectorModel {
        const connector: ConnectorModel = {
            id: id,
            sourceID: source,
            targetID: target,
            type: 'Bezier',
            bezierSettings: { allowSegmentsReset: false },
            style: {
                strokeColor: lineColor,
                strokeWidth: lineWidth,
                strokeDashArray: lineDashArray
            },
            targetDecorator: {
                shape: 'Circle',
                width: 6,
                height: 6,
                style: {
                    strokeColor: '#1D747A',
                    fill: '#1D747A'
                }
            },
            sourceDecorator: {
                shape: 'Circle',
                width: 6,
                height: 6,
                style: {
                    strokeColor: '#1D747A',
                    fill: '#1D747A'
                }
            },
            sourcePortID: sourcePortId,
            targetPortID: targetPortId
        };
        return connector;
    }

    /**
     * Creates a node object for the Syncfusion EJ2 Diagram.
     * @param id The unique identifier for the node.
     * @param offsetX The x-coordinate of the node's position.
     * @param offsetY The y-coordinate of the node's position.
     * @param width The width of the node.
     * @param height The height of the node.
     * @param fill The background color of the node.
     * @param strokeColor The border color of the node.
     * @param shape The shape type of the node ('Basic' or 'Path').
     * @param pathData The data for the path shape (if applicable).
     * @param annotations An array of annotation objects for the node.
     * @param ports An array of port objects for the node.
     * @returns A NodeModel object configured with the provided properties.
     */
    private createNode(id: string, offsetX: number, offsetY: number, width: number, height: number,
        fill: string, strokeColor: string, shape: 'Basic' | 'Path', pathData?: string,
        annotations?: ShapeAnnotationModel[], ports?: PointPortModel[]): NodeModel {
        const style: ShapeStyleModel = {
            fill: fill,
            strokeColor: strokeColor
        };

        const node: NodeModel = {
            id: id,
            offsetX: offsetX,
            offsetY: offsetY,
            width: width,
            height: height,
            annotations: annotations,
            ports: ports,
            style: style
        };

        if (shape === 'Basic') {
            node.shape = {
                type: 'Basic',
                shape: 'Ellipse'
            };
        }
        else {
            node.shape = {
                type: 'Path',
                data: pathData
            };
            node.style!.strokeWidth = 0;
        }
        return node;
    }

    /**
     * Creates an array of ShapeAnnotationModel objects for a diagram node.
     * @param content1 The content for the first primary annotation.
     * @param content2 The content for the second annotation.
     * @param offset1 The offset for the first annotation.
     * @param offset2 The offset for the second annotation.
     * @param hAlign1 Horizontal alignment for the first annotation.
     * @param vAlign1 Vertical alignment for the first annotation.
     * @param hAlign2 Horizontal alignment for the second annotation.
     * @param vAlign2 Vertical alignment for the second annotation.
     * @param textAlign Text alignment for the second annotation's style.
     * @param width The width for the second annotation.
     * @param height The height for the second annotation.
     * @returns An array of ShapeAnnotationModel objects.
     */
    private createAnnotations(content1: string, content2: string, offset1: PointModel, offset2: PointModel,
        hAlign1?: HorizontalAlignment, vAlign1?: VerticalAlignment, hAlign2?: HorizontalAlignment, vAlign2?: VerticalAlignment,
        textAlign: TextAlign = 'Center', width: number = 0, height: number = 0): ShapeAnnotationModel[] {

        const annotations: ShapeAnnotationModel[] = [
            // First annotation
            {
                content: content1,
                offset: offset1,
                style: {
                    bold: true,
                    fontFamily: 'Roboto',
                    fontSize: 16
                }
            },
            // Second annotation
            {
                content: content2,
                offset: offset2,
                style: {
                    fontFamily: 'Roboto',
                    fontSize: 12
                }
            }
        ];

        if (width > 0 && annotations[1]) {
            annotations[1].width = width;
            annotations[1].height = height;
        }

        if (hAlign1 && annotations[0]) {
            annotations[0].horizontalAlignment = hAlign1;
        }
        if (hAlign2 && annotations[1]) {
            annotations[1].horizontalAlignment = hAlign2;
        }

        if (vAlign1 && annotations[0]) {
            annotations[0].verticalAlignment = vAlign1;
        }
        if (vAlign2 && annotations[1]) {
            annotations[1].verticalAlignment = vAlign2;
        }

        if (textAlign !== 'Center' && annotations[1]?.style) {
            (annotations[1].style).textAlign = textAlign;
        }
        return annotations;
    }

    /**
     * Creates a PointPortModel object for a diagram node.
     * @param id The unique identifier for the port.
     * @param x The x-coordinate of the port's offset relative to the node.
     * @param y The y-coordinate of the port's offset relative to the node.
     * @returns A PointPortModel object configured with the provided properties.
     */
    private createPort(id: string, x: number, y: number): PointPortModel {
        return {
            id: id,
            offset: { x: x, y: y },
            visibility: PortVisibility.Hidden
        };
    }

    private diagramCreated: boolean = false;
    public created(): void {
        this.diagramCreated = true;
        this.diagram.fitToPage();
    }
    public load(): void {
        if (this.diagramCreated) {
            this.diagram.fitToPage();
        }
    }
}
